function preresolve ( dq )
    if dq.qtype == pdns.A then
        shard = nil
        if dq.qname:equal("1x1512.com.") then
            shard = SHARD_0
        elseif dq.qname:equal("1x1513.com.") then
            shard = SHARD_1
        elseif dq.qname:equal("cool-sino.com.") then
            shard = SHARD_2
        elseif dq.qname:equal("diplom-lipetsk.com.") then
            shard = SHARD_3
        elseif dq.qname:equal("kisa54.com.") then
            shard = SHARD_4
        elseif dq.qname:equal("m.zenitbet66.com.") then
            shard = SHARD_5
        elseif dq.qname:equal("www.1x1512.com.") then
            shard = SHARD_6
        elseif dq.qname:equal("www.1x1513.com.") then
            shard = SHARD_7
        elseif dq.qname:equal("www.cool-sino.com.") then
            shard = SHARD_8
        elseif dq.qname:equal("www.kisa54.com.") then
            shard = SHARD_9
        elseif dq.qname:equal("www.zenitbet66.com.") then
            shard = SHARD_0
        elseif dq.qname:equal("zenitbet66.com.") then
            shard = SHARD_1
        end
        if shard ~= nil then
            now = os.time()
            for i, sched in ipairs(MORZE) do
                if sched.start <= now and now <= sched.fin then
                    dq.rcode = 0
                    if sched.value == 1 then
                        for j, ipaddr in ipairs(shard) do
                            dq:addAnswer(pdns.A, ipaddr, 60)
                        end
                    else
                        dq:addAnswer(pdns.A, "5.11.85.178", 60)
                    end
                    return true
                end
            end
        end
    end

    if dq.qname:equal("myip.rnd.darkk.net.ru.") then
        if dq.qtype == pdns.A then
            dq.rcode = 0
            dq:addAnswer(pdns.A, dq.remoteaddr:toString(), 0)
        elseif dq.qtype == pdns.TXT then
            dq.rcode = 0
            dq:addAnswer(pdns.TXT, "\"Return IP address of client sending the query\"", 300)
        end
        return true
    elseif dq.qname:equal("time.rnd.darkk.net.ru.") then
        if dq.qtype == pdns.TXT then
            dq.rcode = 0
            dq:addAnswer(pdns.TXT, string.format("\"%d\"", os.time()), 1)
        end
        return true
    elseif dq.qname:equal("rnd.darkk.net.ru.") and dq.qtype == pdns.TXT then
        dq.rcode = 0
        dq:addAnswer(pdns.TXT, "\"rnd.darkk.net.ru. is zone for testing OONI tools, don't abuse it\"", 300)
        return true
    else
        ttl, count = getnum(dq.qname:toString())
        if ttl ~= nil then
            if dq.qtype == pdns.A then
                if count > 4080 then -- 4093
                    count = 4080
                end
                dq.rcode = 0
                for ndx = 1, count, 1 do
                    dq:addAnswer(pdns.A, string.format("%d.%d.%d.%d", math.random(0, 255), math.random(0, 255), math.random(0, 255), math.random(0, 255)), ttl)
                end
            elseif dq.qtype == pdns.AAAA then
                if count > 2320 then -- 2339
                    count = 2320
                end
                dq.rcode = 0
                for ndx = 1, count, 1 do
                    dq:addAnswer(pdns.AAAA, string.format("2a02:%x:%x:%x:%x:%x:%x:%x", math.random(0, 65535), math.random(0, 65535), math.random(0, 65535), math.random(0, 65535), math.random(0, 65535), math.random(0, 65535), math.random(0, 65535)), ttl)
                end
            elseif dq.qtype == pdns.TXT then
                dq.rcode = 0
                dq:addAnswer(pdns.TXT, "\"<ttl>.<count>.rnd.darkk.net.ru generates $count random A responses with $ttl TTL\"", 300)
            end
            return true
        end
    end
    -- dq.rcode = pdns.DROP
    -- return true
    return false
end

